description:
Перевод оригинального ролика http://wwmgd.blogspot.com в котором рассказывается, как своими руками изготовить металлоискатель у себя дома.
Вам понадобятся:
- калькулятор без солнечной батареи;
- наушники;
- CD-R и DVD-R диск;
- изолента;
- 9 вольтная батарейка типа "Крона";
- клей;
- ножницы.
